🌸 مجموعةالتحسيس  للأم المرضعة

🌱 المجموعة مصممة خصيصآ لتنحيف آلام المرضعة، حوالي 5 كيلو، ممكن أكثر ممكن أقل حسب طبيعة الجسم وكمان بشرط الالتزام بالتعاليم المرفقة.

🌱 مكونات المجموعة :
ميلك شيك
 شاي الوهيربال 
حبوب الفيلدز

🌱 شرح كل مكون ؛

- ميلك شيك "الترا لايت" منتج بديل البروتين ، في منو نوعين ، نوع بطعم الشوكلا ونوع بطعم الفانيلا ، عبارة عن مسحوق غني بالبروتين والفيتامينات والمعادن وبحتوي كمان على ١٨ حمض اميني مهم لبناء الجسم 🌸

- الشاي "هيرابيل تي" : افضل نوع من شاي الاعشاب المتوفر حالياً على مستوى العالم ، يحتوي على اوراق واعشاب وتوابل وبتميز بنكهة لذيذة ، مفيد جداً للاشخاص الذين يعانون من الارق وغني بفيتامين سي عدا عن وظيفته في التخسيس 🌸

